import React, {useState, useEffect} from "react";
import {useHistory} from "react-router-dom";


function Login(){
    	const [email, setEmail]=useState();
        const [password, setPassword]=useState();
        const history=useHistory();
    
    
   
        return(
            <div>
                <div className="Container">
                    <div className="inner-box">
                        <div className="acc-row1">
                            <h1 className="accHeading">Enter Your Login Details Below...</h1>
                            <p className="accParaDetail">Enter your details below to login or continue as guest by clicking on the button below</p>
                        </div>
                        <div className="loginAccForm">
                            <form method="" action="">
                                <input  type="text" placeholder="Enter Your Username" name="login_username" 
                                onChange={(e)=>setEmail(e.target.value)}  ></input>
                                <input  type="password" placeholder="Enter Your Password" name="login_password" 
                                onChange={this.inputChanged}  ></input>
                                <button onClick={this.login}  className="loginButton"  type="submit">Sign In</button>    
                            </form>

                       
                        </div>
                    </div>
                </div>
            </div>
        );
    
}
export default Login;
